import React, { Component } from 'react';
import JobForm from '../components/JobForm';

class JobFeed extends Component {
	constructor(props) {
		super(props);
		this.state = {
			displayJobForm: false
		};
	}

	displayJobForm = () => {
		this.setState({
			displayJobForm: !this.state.displayJobForm
		});
	};

	render() {
		let jobForm;

		if (this.state.displayJobForm) {
			jobForm = <JobForm />;
		}
		return (
			<React.Fragment>
				<table class='table'>
					<thead>
						<tr>
							<th>
								<abbr title='Position'>Company Name</abbr>
							</th>
							<th>Position</th>
							<th>Location</th>
							<th>Notes</th>
						</tr>
					</thead>
					<tbody>
						<tr>
							<th>Accenture</th>
							<td>Software Engineer</td>
							<td>NYC, New York</td>
							<td>Company culture is nice and good salary</td>
						</tr>
					</tbody>
				</table>
				<button class='button is-fullwidth' onClick={this.displayJobForm}>
					Add a Job
				</button>
				{jobForm}
			</React.Fragment>
		);
	}
}

export default JobFeed;
